import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import NavBar from './NavBar';
import ListDividers from './ListDividers';

const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
    },
    cards: {
        height: '89vh'
      },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
      margin: '15px'
    },
  }));

  function createData(id, name) {
    return {id, name};
  }

  const speeches = [
    createData(0, 'Frozen yoghurt'),
    createData(1, 'Ice cream sandwich'),
    createData(2, 'Eclair'),
    createData(3, 'Cupcake'),
    createData(4, 'Gingerbread'),
  ];

export default function HomePage() {
    const classes = useStyles();
    return (
        <div>
            <NavBar />
            <Grid container spacing={0}
                    direction="row"
                    justify="flex-start"
                    alignItems="stretch">
                <Grid item xs={2}>
                    <ListDividers/>
                </Grid>
                <Grid item xs={10}>
                <div id="cards">
                    <Grid container spacing={2}
                        direction="row"
                        justify="flex-start"
                        alignItems="baseline"> 
                        {speeches.map(speech => (
                            <Grid key={speech.id} item xs={3}>
                                <Paper className={classes.paper}>speech.name</Paper>
                            </Grid>
                        ))}                   
                    </Grid>
                </div>
                </Grid>
            </Grid>
        </div>
    );
}
